import React from "react";
import {Card} from "react-bootstrap";

const ContauctUs = (props) => {

    return(
        <div className='ContauctUs'>
            <h2 className='ContauctUs-title'>

            </h2>
            <div className=' col-12 col-sm-6 col-md-4 col-lg-4 col-xl-3'>
                <Card className='ContactUs-card g-9'>
                    {/*<Card.Img className='CardImg' src={props.card.image}></Card.Img>*/}
                    <Card.Title>
                        {props.card.title}
                    </Card.Title>
                    <Card.Text>
                        {props.card.content1}<br/>
                        {props.card.content2}
                    </Card.Text>
                </Card>
            </div>
        </div>
    );
};

export default ContauctUs;
